#[inline(always)]
fn fmul(a: Fixed, b: Fixed) -> Fixed {
    (((a as i32 * b as i32) >> 8) as i16)
}
#[inline(always)]
fn relu(x: Fixed) -> Fixed {
    if x < 0 {
        0
    } else {
        x
    }
}

fn run_nn(inp: &[u8; IN_SIZE]) -> u8 {
    let mut hid = [0i16; HIDDEN_SIZE];
    let mut out = [0i16; OUT_SIZE];

    for i in 0..HIDDEN_SIZE {
        let mut acc = 0i32;
        for j in 0..IN_SIZE {
            acc += fmul(W1[i][j], inp[j] as i16 * SCALE as i16) as i32;
        }
        hid[i] = relu((acc + B1[i] as i32) as i16);
    }
    for i in 0..OUT_SIZE {
        let mut acc = 0i32;
        for j in 0..HIDDEN_SIZE {
            acc += fmul(W2[i][j], hid[j]) as i32;
        }
        out[i] = (acc + B2[i] as i32) as i16;
    }
    out.iter()
        .enumerate()
        .max_by_key(|(_, v)| *v)
        .map(|(i, _)| i as u8)
        .unwrap()
}

struct Cursor {
    x: u16,
    y: u16,
}
impl Cursor {
    const fn new() -> Self {
        Self {
            x: CANVAS_X + CANVAS_INNER / 2 - CURSOR_SIZE / 2,
            y: CANVAS_Y + CANVAS_INNER / 2 - CURSOR_SIZE / 2,
        }
    }
    fn step(&mut self, k: KeyInput) {
        if k.left() && self.x > CANVAS_X {
            self.x -= 1;
        }
        if k.right() && self.x < CANVAS_X + CANVAS_INNER - CURSOR_SIZE {
            self.x += 1;
        }
        if k.up() && self.y > CANVAS_Y {
            self.y -= 1;
        }
        if k.down() && self.y < CANVAS_Y + CANVAS_INNER - CURSOR_SIZE {
            self.y += 1;
        }
    }
}

static CUR_X: GbaCell<u16> = GbaCell::new(0);
static CUR_Y: GbaCell<u16> = GbaCell::new(0);
static PREV_X: GbaCell<u16> = GbaCell::new(0);
static PREV_Y: GbaCell<u16> = GbaCell::new(0);
static PREV_DRAW: GbaCell<u16> = GbaCell::new(0);
static A_HELD: GbaCell<u16> = GbaCell::new(0);

// backup of pixels under the cursor
static mut CUR_BACK: [[Color; CURSOR_SIZE as usize]; CURSOR_SIZE as usize] =
    [[Color::BLACK; CURSOR_SIZE as usize]; CURSOR_SIZE as usize];

#[no_mangle]
extern "C" fn main() -> ! {
    // video mode
    DISPCNT.write(
        DisplayControl::new()
            .with_video_mode(VideoMode::_3)
            .with_show_bg2(true),
    );
    video3_clear_to(Color::BLACK);
    draw_frame();

    // enable VBlank IRQ
    RUST_IRQ_HANDLER.write(Some(vblank));
    DISPSTAT.write(DisplayStatus::new().with_irq_vblank(true));
    IE.write(IrqBits::VBLANK);
    IME.write(true);

    let mut logger = MgbaBufferedLogger::try_new(MgbaMessageLevel::Debug).unwrap();
    let mut cursor = Cursor::new();

    loop {
        let k = KEYINPUT.read();

        // canvas reset with B or SELECT
        if k.b() || k.select() {
            clear_canvas();
        }

        // automatic inference every INFER_INTERVAL_FRAMES
        if k.start() {
            infer_and_show(&mut logger);
        }

        // cursor update & input state sharing
        cursor.step(k);
        CUR_X.write(cursor.x);
        CUR_Y.write(cursor.y);
        A_HELD.write(k.a() as u16);

        VBlankIntrWait();
    }
}

#[inline(always)]
fn dist2(dx: u16, dy: u16) -> i32 {
    let r = (CURSOR_SIZE / 2) as i32;
    let cx = dx as i32 - r;
    let cy = dy as i32 - r;
    cx * cx + cy * cy
}
const R_OUT2:  i32 =  (CURSOR_SIZE / 2) as i32 * (CURSOR_SIZE / 2) as i32;    // 25
const R_IN2:   i32 = ((CURSOR_SIZE / 2) as i32 - 1).pow(2);                   // 16

// draw filled disc or disc+outline ------------------------------------
fn draw_disc(x: u16, y: u16, with_border: bool) {
    for dy in 0..CURSOR_SIZE {
        for dx in 0..CURSOR_SIZE {
            let d2 = dist2(dx, dy);
            if d2 <= R_OUT2 {
                let c = if with_border && d2 >= R_IN2 { Color::BLACK }
                        else                          { Color::WHITE };
                VIDEO3_VRAM
                    .index((x + dx) as usize, (y + dy) as usize)
                    .write(c);
            }
        }
    }
}

// ───────── V-Blank IRQ ─────────
#[link_section = ".iwram.vblank"]
extern "C" fn vblank(_: IrqBits) {
    let x  = CUR_X.read();   let y  = CUR_Y.read();
    let px = PREV_X.read();  let py = PREV_Y.read();

    let a_now  = A_HELD.read()    != 0;
    let a_prev = PREV_DRAW.read() != 0;

    // 1) always restore the old 10×10 background
    unsafe {
        for dy in 0..CURSOR_SIZE {
            for dx in 0..CURSOR_SIZE {
                VIDEO3_VRAM
                    .index((px + dx) as usize, (py + dy) as usize)
                    .write(CUR_BACK[dy as usize][dx as usize]);
            }
        }
    }
    // 2) if last frame was drawing, stamp the white ink (no outline)
    if a_prev {
        draw_disc(px, py, false);
    }

    // 3) grab background under NEW cursor
    unsafe {
        for dy in 0..CURSOR_SIZE {
            for dx in 0..CURSOR_SIZE {
                CUR_BACK[dy as usize][dx as usize] =
                    VIDEO3_VRAM
                        .index((x + dx) as usize, (y + dy) as usize)
                        .read();
            }
        }
    }
    // 4) draw visible cursor (white + black rim)
    draw_disc(x, y, true);

    // 5) update shared cells
    PREV_X.write(x); PREV_Y.write(y);
    PREV_DRAW.write(a_now as u16);
}

fn infer_and_show(log: &mut MgbaBufferedLogger) {
    const S: u16 = 28; // output size
    const BL: u16 = 5; // 140 / 28
    let mut inp = [0u8; IN_SIZE];

    // down-sample canvas to 28×28 (OR within 5×5 block)
    for oy in 0..S {
        for ox in 0..S {
            let mut white = false;
            'block: for by in 0..BL {
                for bx in 0..BL {
                    if VIDEO3_VRAM
                        .index(
                            (CANVAS_X + ox * BL + bx) as usize,
                            (CANVAS_Y + oy * BL + by) as usize,
                        )
                        .read()
                        == Color::WHITE
                    {
                        white = true;
                        break 'block;
                    }
                }
            }
            inp[(oy * S + ox) as usize] = white as u8;
        }
    }

    for i in 0..28 {
      for j in 0..28 {
        write!(log, "{}", inp[(i * S) as usize + j as usize]).ok();
      }
      writeln!(log).ok();
    }

    let digit = run_nn(&inp);
    show_digit(digit);
    writeln!(log, "[infer] result = {}", digit).ok();
}

fn show_digit(digit: u8) {
    // clear old glyph
    draw_rect(RESULT_X, RESULT_Y, 8, 8, Color::BLACK);

    // draw new glyph
    let glyph = &DIGITS[digit as usize];
    for (row, bits) in glyph.iter().enumerate() {
        for col in 0..8 {
            if bits & (0x80 >> col) != 0 {
                VIDEO3_VRAM
                    .index((RESULT_X + col) as usize, (RESULT_Y + row as u16) as usize)
                    .write(Color::WHITE);
            }
        }
    }
}

fn clear_canvas() {
    draw_rect(CANVAS_X, CANVAS_Y, CANVAS_INNER, CANVAS_INNER, Color::BLACK);
    draw_frame();
    unsafe {
        for row in &mut CUR_BACK {
            for px in row {
                *px = Color::BLACK;
            }
        }
    }
}

fn draw_frame() {
    // horizontal
    draw_rect(FRAME_X, FRAME_Y, CANVAS_OUTER, CANVAS_BORDER, Color::WHITE);
    draw_rect(
        FRAME_X,
        FRAME_Y + CANVAS_OUTER - CANVAS_BORDER,
        CANVAS_OUTER,
        CANVAS_BORDER,
        Color::WHITE,
    );
    // vertical
    draw_rect(FRAME_X, FRAME_Y, CANVAS_BORDER, CANVAS_OUTER, Color::WHITE);
    draw_rect(
        FRAME_X + CANVAS_OUTER - CANVAS_BORDER,
        FRAME_Y,
        CANVAS_BORDER,
        CANVAS_OUTER,
        Color::WHITE,
    );
}

#[link_section = ".iwram.rect"]
fn draw_rect(x: u16, y: u16, w: u16, h: u16, col: Color) {
    for dy in 0..h {
        for dx in 0..w {
            VIDEO3_VRAM
                .index((x + dx) as usize, (y + dy) as usize)
                .write(col);
        }
    }
}

#[inline(always)]
fn inside_circle(dx: u16, dy: u16) -> bool {
    const R: i32 = (CURSOR_SIZE / 2) as i32;            // 5
    let cx = dx as i32 - R;
    let cy = dy as i32 - R;
    cx * cx + cy * cy <= R * R                          // (x-r)^2+(y-r)^2 ≤ r²
}

fn draw_circle(x: u16, y: u16, col: Color) {
    for dy in 0..CURSOR_SIZE {
        for dx in 0..CURSOR_SIZE {
            if inside_circle(dx, dy) {
                VIDEO3_VRAM
                    .index((x + dx) as usize, (y + dy) as usize)
                    .write(col);
            }
        }
    }
}

#[panic_handler]
fn panic(info: &core::panic::PanicInfo) -> ! {
    if let Ok(mut l) = MgbaBufferedLogger::try_new(MgbaMessageLevel::Fatal) {
        writeln!(l, "{info}").ok();
    }
    loop {}
}
